<script>
import html2canvas from 'html2canvas'
import Swiper from 'swiper';
import 'swiper/dist/css/swiper.min.css';

export default {
  components: {},
  props: {},
  data() {
    return {
        color:"",
        domes:[],
        creatImgUrl:'',
        panSwiper:''
    };
  },
  created() {
    
  },
  mounted() {
    
    let _this = this
      this.$nextTick(()=>{
          //swiper初始化实例
           this.panSwiper = new Swiper('.panbox')
      })
  },
  methods: {
      changeColor(name){
          if(this.color == ''){
              this.$dialog.toast({
                    mes: '请先选择一个画笔',
                    timeout: 1500
               });
          }else{
            //把相同class的path都填充颜色
            this.domes  = document.getElementsByClassName(name)
            this.domes.forEach((demo)=>{
                demo.style.fill = this.color
            })
          } 
      },
      slidePrev(){
        this.panSwiper.slidePrev();
      },
      slideNext(){
        this.panSwiper.slideNext();
      },
      createPost(){ 
        //设置svg宽高
        let www = window.getComputedStyle(this.$refs.paintbox).width
        let hhh = window.getComputedStyle(this.$refs.paintbox).height
        this.$refs.paintbox.setAttribute('width',www)
        this.$refs.paintbox.setAttribute('height',hhh)
         this.$nextTick(()=>{
             
            if(this.color == ''){
                this.$dialog.toast({
                    mes: '您还没有进行涂色',
                    timeout: 1500
                });
            }else{
                this.$dialog.loading.open('正在为您生成海报');
                html2canvas(this.$refs.paintbox, {
                    useCORS: true,//允许跨域
                }).then((canvas) => {
                    this.$dialog.loading.close()
                    //生成海报图片---
                    this.creatImgUrl = canvas.toDataURL("image/png").replace("image/png", "image/octet-stream"); // 获取生成的图片的url
                    console.log(this.creatImgUrl)
                    
                }).catch(e=>{
                    console.log(e)
                }) 
            }
         })
          
      }
  },
  watch: {},
  computed: {},
};
</script>
